		let sequence = [];
		let effectiveCount = n;
		for(let i=0; i < n; ++i) {
			circle.push(i+1);
		}
		let pos = s-1;

		while(circle.length > 1) {
			pos = (pos + k)
			if (pos >= circle.length) {
				pos = (pos % circle.length);
			} 
			r = circle.splice(pos - 1, 1)[0];
			pos = pos - 1;
			sequence.push(r);
		}
		sequence.push(circle[0]);
		return sequence;
	}
}

